      {tooltip && tooltip === children && (
        <TooltipContent>{tooltip}</TooltipContent>
      )}
    </>
  );
};

const TooltipContent = ({ children }) => {
  return {children};
};

export { TooltipProvider, Tooltip, TooltipContent };
\end{code}

The problem is that the `Tooltip` component is not aware of the other `Tooltip` components. So when a new `Tooltip` is opened, the previously opened one is not closed.

I'm trying to find a way to close the previously opened `Tooltip` when a new one is opened.

I've tried to use `useEffect` to close the previously opened `Tooltip` when the `tooltip` state changes, but it doesn't work as expected.

Here is the code:

\begin{code}
useEffect(() => {
  if (tooltip) {
    closeTooltip();
  }
}, [tooltip]);
\end{code}

This code closes the `Tooltip` immediately after it's opened, which is not what I want.

I want to close the previously opened `Tooltip` when a new one is opened.

Can anyone help me with this?

Answer:

I've found a solution to this problem. The issue is that the `Tooltip` component is not aware of the other `Tooltip` components. To solve this, I've added a `useRef` to keep track of the currently opened `Tooltip`.

Here is the updated code:

\begin{code}
import React, { useState, useEffect, useRef } from 'react';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);
  const currentTooltipRef = useRef(null);

  const openTooltip = (tooltip) => {
    if (currentTooltipRef.current) {
      closeTooltip();
    }
    setTooltip(tooltip);
    currentTooltipRef.current = tooltip;
  };

  const closeTooltip = () => {
    setTooltip(null);
    currentTooltipRef.current = null;
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, tooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const Tooltip = ({ children }) => {
  const { openTooltip, closeTooltip, tooltip } = useContext(TooltipContext);

  const handleMouseOver = () => {
    openTooltip(children);
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <>

        {children}

      {tooltip && tooltip === children && (
        <TooltipContent>{tooltip}</TooltipContent>
      )}
    </>
  );
};

const TooltipContent = ({ children }) => {
  return {children};
};

export { TooltipProvider, Tooltip, TooltipContent };
